import axios from 'axios';

export const MOSTRAR_CONFIGURACION = 'MOSTRAR_CONFIGURACION'


export function actionConfiguracion(prueba) {
    return (dispatch, getState) => {
        dispatch({
            type: MOSTRAR_CONFIGURACION,
            prueba: prueba
        });
    }
}
